import React from 'react'

const Face = ({imageUrl, box}) => {
    return (
        <div className='center'>
            <div className='absolute mt2'>
                <img id='inputImage' alt='' src={imageUrl} width='500px' height='auto' />
                <div className='bounding-box'></div>
            </div>
        </div>
    );
}


export default Face;
